import React, {Component} from 'react';
import styled from  'styled-components';

class Login extends Component {
    render() {
        return(
            <div>
                <LoginForm>
                    <LoginText><h1>로그인</h1></LoginText>
                    <div> 
                    <input type='text' className='id' placeholder='아이디'></input>
                    </div>
                   <div>
                   <input type='text' className='password' placeholder='비밀번호'></input>
                   </div>
                   <LoginBtn type='button' className='loginbtn'>
                       로그인                  
                   </LoginBtn>
                </LoginForm>
            </div>
        )
    }
}

export default Login;

const LoginText = styled.h1`
    color: #00587a;
    margin-left:55px;
`

const LoginForm = styled.div`
    margin-top: 200px;
`
const LoginBtn = styled.button`
   margin-left:55px;
   margin-top:30px;
   background-color: #fff8cd;
`
